import { Checker, CheckResult, CheckStatus } from '@stryker-mutator/api/check';
import { Mutant, StrykerOptions } from '@stryker-mutator/api/core';
import { Disposable } from 'typed-inject';

import { ChildProcessProxy } from '../child-proxy/child-process-proxy';
import { LoggingClientContext } from '../logging';
import { Resource } from '../concurrent/pool';

import { CheckerWorker } from './checker-worker';

export class CheckerChildProcessProxy implements Checker, Disposable, Resource {
  private readonly childProcess: ChildProcessProxy<CheckerWorker>;

  constructor(options: StrykerOptions, loggingContext: LoggingClientContext) {
    this.childProcess = ChildProcessProxy.create(require.resolve('./checker-worker'), loggingContext, options, {}, process.cwd(), CheckerWorker, []);
  }

  public async dispose(): Promise<void> {
    await this.childProcess?.dispose();
  }

  public async init(): Promise<void> {
    await this.childProcess?.proxy.init();
  }

  public async check(mutant: Mutant): Promise<CheckResult> {
    if (this.childProcess) {
      return this.childProcess.proxy.check(mutant);
    }
    return {
      status: CheckStatus.Passed,
    };
  }
}

import { CheckResult } from '@stryker-mutator/api/check';
import { Mutant } from '@stryker-mutator/api/core';

import { ChildProcessCrashedError } from '../child-proxy/child-process-crashed-error';
import { ResourceDecorator } from '../concurrent';

import { CheckerResource } from './checker-resource';

export class CheckerDecorator extends ResourceDecorator<CheckerResource> {
  public async check(mutant: Mutant): Promise<CheckResult> {
    try {
      return await this.innerResource.check(mutant);
    } catch (err) {
      if (err instanceof ChildProcessCrashedError) {
        await this.recover();
        return this.innerResource.check(mutant);
      } else {
        throw err; //oops
      }
    }
  }
}

import { StrykerOptions } from '@stryker-mutator/api/core';
import { LoggerFactoryMethod } from '@stryker-mutator/api/logging';
import { commonTokens, tokens } from '@stryker-mutator/api/plugin';

import { coreTokens } from '../di';
import { LoggingClientContext } from '../logging/logging-client-context';

import { CheckerChildProcessProxy } from './checker-child-process-proxy';
import { CheckerResource } from './checker-resource';
import { CheckerRetryDecorator } from './checker-retry-decorator';

createCheckerFactory.inject = tokens(commonTokens.options, coreTokens.loggingContext, commonTokens.getLogger);
export function createCheckerFactory(
  options: StrykerOptions,
  loggingContext: LoggingClientContext,
  getLogger: LoggerFactoryMethod
): () => CheckerResource {
  return () => new CheckerRetryDecorator(() => new CheckerChildProcessProxy(options, loggingContext), getLogger(CheckerRetryDecorator.name));
}

import { CheckResult } from '@stryker-mutator/api/check';
import { Mutant } from '@stryker-mutator/api/core';
import { Logger } from '@stryker-mutator/api/logging';

import { ChildProcessCrashedError } from '../child-proxy/child-process-crashed-error';
import { OutOfMemoryError } from '../child-proxy/out-of-memory-error';
import { ResourceDecorator } from '../concurrent';

import { CheckerResource } from './checker-resource';

export class CheckerRetryDecorator extends ResourceDecorator<CheckerResource> implements CheckerResource {
  constructor(producer: () => CheckerResource, private readonly log: Logger) {
    super(producer);
  }

  public async check(mutant: Mutant): Promise<CheckResult> {
    try {
      return await this.innerResource.check(mutant);
    } catch (error) {
      if (error instanceof ChildProcessCrashedError) {
        if (error instanceof OutOfMemoryError) {
          this.log.warn(`Checker process [${error.pid}] ran out of memory. Retrying in a new process.`);
        } else {
          this.log.warn(`Checker process [${error.pid}] crashed with exit code ${error.exitCode}. Retrying in a new process.`, error);
        }
        await this.recover();
        return this.innerResource.check(mutant);
      } else {
        throw error; //oops
      }
    }
  }
}

import { Checker, CheckResult, CheckStatus } from '@stryker-mutator/api/check';
import { StrykerOptions, Mutant } from '@stryker-mutator/api/core';
import { PluginKind, tokens, commonTokens, PluginContext, Injector } from '@stryker-mutator/api/plugin';
import { StrykerError } from '@stryker-mutator/util';

import { PluginCreator } from '../di';

export class CheckerWorker implements Checker {
  private readonly innerCheckers: Array<{ name: string; checker: Checker }> = [];

  public static inject = tokens(commonTokens.options, commonTokens.injector);
  constructor(options: StrykerOptions, injector: Injector<PluginContext>) {
    const pluginCreator = injector.injectFunction(PluginCreator.createFactory(PluginKind.Checker));
    this.innerCheckers = options.checkers.map((name) => ({ name, checker: pluginCreator.create(name) }));
  }
  public async init(): Promise<void> {
    for await (const { name, checker } of this.innerCheckers) {
      try {
        await checker.init();
      } catch (error: unknown) {
        throw new StrykerError(`An error occurred during initialization of the "${name}" checker`, error);
      }
    }
  }
  public async check(mutant: Mutant): Promise<CheckResult> {
    for await (const { checker } of this.innerCheckers) {
      const result = await checker.check(mutant);
      if (result.status !== CheckStatus.Passed) {
        return result;
      }
    }
    return { status: CheckStatus.Passed };
  }
}

import path from 'path';

import { errorToString } from '@stryker-mutator/util';
import { getLogger, Logger } from 'log4js';

import { buildChildProcessInjector } from '../di';
import { LogConfigurator } from '../logging';
import { deserialize, serialize } from '../utils/string-utils';

import { autoStart, CallMessage, ParentMessage, ParentMessageKind, WorkerMessage, WorkerMessageKind, InitMessage } from './message-protocol';

export class ChildProcessProxyWorker {
  private log?: Logger;

  public realSubject: any;

  constructor() {
    // Make sure to bind the methods in order to ensure the `this` pointer
    this.handleMessage = this.handleMessage.bind(this);
    process.on('message', this.handleMessage);
  }

  private send(value: ParentMessage) {
    if (process.send) {
      const str = serialize(value);
      process.send(str);
    }
  }
  private handleMessage(serializedMessage: string) {
    const message = deserialize<WorkerMessage>(serializedMessage);
    switch (message.kind) {
      case WorkerMessageKind.Init:
        this.handleInit(message);
        this.removeAnyAdditionalMessageListeners(this.handleMessage);
        break;
      case WorkerMessageKind.Call:
        this.handleCall(message);
        this.removeAnyAdditionalMessageListeners(this.handleMessage);
        break;
      case WorkerMessageKind.Dispose:
        const sendCompleted = () => {
          this.send({ kind: ParentMessageKind.DisposeCompleted });
        };
        LogConfigurator.shutdown().then(sendCompleted).catch(sendCompleted);
        break;
    }
  }

  private handleInit(message: InitMessage) {
    LogConfigurator.configureChildProcess(message.loggingContext);
    this.log = getLogger(ChildProcessProxyWorker.name);
    this.handlePromiseRejections();
    let injector = buildChildProcessInjector(message.options);
    const locals = message.additionalInjectableValues as Record<string, unknown>;
    for (const token in locals) {
      injector = injector.provideValue(token, locals[token]);
    }
    // we want it sync
    // eslint-disable-next-line @typescript-eslint/no-require-imports
    const RealSubjectClass = require(message.requirePath)[message.requireName];
    const workingDir = path.resolve(message.workingDirectory);
    if (process.cwd() !== workingDir) {
      this.log.debug(`Changing current working directory for this process to ${workingDir}`);
      process.chdir(workingDir);
    }
    // eslint-disable-next-line @typescript-eslint/no-unsafe-argument
    this.realSubject = injector.injectClass(RealSubjectClass);
    this.send({ kind: ParentMessageKind.Initialized });
  }

  private async handleCall(message: CallMessage) {
    try {
      const result = await this.doCall(message);
      this.send({
        correlationId: message.correlationId,
        kind: ParentMessageKind.Result,
        result,
      });
    } catch (err) {
      this.send({
        correlationId: message.correlationId,
        error: errorToString(err),
        kind: ParentMessageKind.Rejection,
      });
    }
  }

  private doCall(message: CallMessage): PromiseLike<Record<string, unknown>> | Record<string, unknown> | undefined {
    if (typeof this.realSubject[message.methodName] === 'function') {
      return this.realSubject[message.methodName](...message.args);
    } else {
      return this.realSubject[message.methodName];
    }
  }

  /**
   * Remove any addition message listeners that might me eavesdropping.
   * the @ngtools/webpack plugin listens to messages and throws an error whenever it could not handle a message
   * @see https://github.com/angular/angular-cli/blob/f776d3cf7982b64734c57fe4407434e9f4ec09f7/packages/%40ngtools/webpack/src/type_checker.ts#L79
   * @param exceptListener The listener that should remain
   */
  private removeAnyAdditionalMessageListeners(exceptListener: NodeJS.MessageListener) {
    process.listeners('message').forEach((listener) => {
      if (listener !== exceptListener) {
        this.log?.debug(
          "Removing an additional message listener, we don't want eavesdropping on our inter-process communication: %s",
          listener.toString()
        );
        process.removeListener('message', listener);
      }
    });
  }

  /**
   * During mutation testing, it's to be expected that promise rejections are not handled synchronously anymore (or not at all)
   * Let's handle those events so future versions of node don't crash
   * See issue 350: https://github.com/stryker-mutator/stryker-js/issues/350
   */
  private handlePromiseRejections() {
    const unhandledRejections: Array<Promise<unknown>> = [];
    process.on('unhandledRejection', (reason, promise) => {
      const unhandledPromiseId = unhandledRejections.push(promise);
      this.log?.debug(`UnhandledPromiseRejectionWarning: Unhandled promise rejection (rejection id: ${unhandledPromiseId}): ${reason}`);
    });
    process.on('rejectionHandled', (promise) => {
      const unhandledPromiseId = unhandledRejections.indexOf(promise) + 1;
      this.log?.debug(`PromiseRejectionHandledWarning: Promise rejection was handled asynchronously (rejection id: ${unhandledPromiseId})`);
    });
  }
}

// Prevent side effects for merely requiring the file
// Only actually start the child worker when it is requested
if (process.argv.includes(autoStart)) {
  new ChildProcessProxyWorker();
}

