import { I } from '@stryker-mutator/util';

import { coreTokens } from '../di';

function mergedSchema(mainSchema: JSONSchema7, additionalSchemas: JSONSchema7[]): JSONSchema7 {
  const schema = {
    ...mainSchema,
    properties: {
      ...mainSchema.properties,
    },
    definitions: {
      ...mainSchema.definitions,
    },
  };

  Object.assign(schema.properties, ...additionalSchemas.map((s) => s.properties));
  Object.assign(schema.definitions, ...additionalSchemas.map((s) => s.definitions));
  return schema;
}

export function buildSchemaWithPluginContributions(schema: JSONSchema7, pluginResolver: I<PluginResolver>, logger: Logger): JSONSchema7 {
  const additionalSchemas = pluginResolver.resolveValidationSchemaContributions();
  logger.debug('Contributing %s schemas from plugins to options validation.', additionalSchemas.length);
  return mergedSchema(schema, additionalSchemas);
}
buildSchemaWithPluginContributions.inject = tokens(coreTokens.validationSchema, commonTokens.pluginResolver, commonTokens.logger);

import path from 'path';

import { PartialStrykerOptions, StrykerOptions } from '@stryker-mutator/api/core';
import { Logger } from '@stryker-mutator/api/logging';
import { commonTokens, tokens } from '@stryker-mutator/api/plugin';
import { deepMerge } from '@stryker-mutator/util';

import { coreTokens } from '../di';
import { ConfigError } from '../errors';

import { defaultOptions, OptionsValidator } from './options-validator';
import { createConfig } from './create-config';

export const CONFIG_SYNTAX_HELP = `
/**
  * @type {import('@stryker-mutator/api/core').StrykerOptions}
  */
module.exports = {
  // You're options here!
}`.trim();

const DEFAULT_CONFIG_FILE = 'stryker.conf';

export class ConfigReader {
  public static inject = tokens(coreTokens.cliOptions, commonTokens.logger, coreTokens.optionsValidator);
  constructor(private readonly cliOptions: PartialStrykerOptions, private readonly log: Logger, private readonly validator: OptionsValidator) {}

  public readConfig(): StrykerOptions {
    const configModule = this.loadConfigModule();
    let options: StrykerOptions;
    if (typeof configModule === 'function') {
      this.log.warn(
        'Usage of `module.exports = function(config) {}` is deprecated. Please use `module.export = {}` or a "stryker.conf.json" file. For more details, see https://stryker-mutator.io/blog/2020-03-11/stryker-version-3#new-config-format'
      );
      options = defaultOptions();
      configModule(createConfig(options));
    } else {
      this.validator.validate(configModule);
      options = configModule;
    }
    // merge the config from config file and cliOptions (precedence)
    deepMerge(options, this.cliOptions);
    if (this.log.isDebugEnabled()) {
      this.log.debug(`Loaded config: ${JSON.stringify(options, null, 2)}`);
    }
    return options;
  }

  private loadConfigModule(): PartialStrykerOptions | ((options: StrykerOptions) => void) {
    let configModule: PartialStrykerOptions | ((config: StrykerOptions) => void) = {};

    if (!this.cliOptions.configFile) {
      try {
        const configFile = require.resolve(path.resolve(`./${DEFAULT_CONFIG_FILE}`));
        this.log.info(`Using ${path.basename(configFile)}`);
        this.cliOptions.configFile = configFile;
      } catch (e) {
        this.log.info('No config file specified. Running with command line arguments.');
        this.log.info('Use `stryker init` command to generate your config file.');
      }
    }

    if (typeof this.cliOptions.configFile === 'string') {
      this.log.debug(`Loading config ${this.cliOptions.configFile}`);
      const configFile = this.resolveConfigFile(this.cliOptions.configFile);
      try {
        // eslint-disable-next-line @typescript-eslint/no-require-imports
        configModule = require(configFile);
      } catch (error: unknown) {
        this.log.info('Stryker can help you setup a `stryker.conf` file for your project.');
        this.log.info("Please execute `stryker init` in your project's root directory.");
        throw new ConfigError('Invalid config file', error);
      }
      if (typeof configModule !== 'function' && typeof configModule !== 'object') {
        this.log.fatal('Config file must export an object!\n' + CONFIG_SYNTAX_HELP);
        throw new ConfigError('Config file must export an object!');
      }
    }

    return configModule;
  }

  private resolveConfigFile(configFileName: string) {
    const configFile = path.resolve(configFileName);
    try {
      return require.resolve(configFile);
    } catch {
      throw new ConfigError(`File ${configFile} does not exist!`);
    }
  }
}

import { deepMerge } from '@stryker-mutator/util';
import { StrykerOptions, PartialStrykerOptions } from '@stryker-mutator/api/core';

/**
 * Adds a `set` method to the options object that can be used as a shorthand to
 * override options using a deep merge algorithm. This is mostly for backward compatibility purposes.
 * @param options The stryker options use
 * @deprecated Please use `StrykerOptions` directly instead
 */
export function createConfig(options: StrykerOptions): StrykerOptions {
  options.set = (newConfig: PartialStrykerOptions) => {
    deepMerge(options, newConfig);
  };
  return options;
}

import path from 'path';

import minimatch from 'minimatch';

/**
 * A helper class for matching files using the `disableTypeChecks` setting.
 */
export class FileMatcher {
  private readonly pattern: string | false;

  constructor(pattern: string | false) {
    if (pattern !== false) {
      this.pattern = path.resolve(pattern);
    } else {
      this.pattern = pattern;
    }
  }

  public matches(fileName: string): boolean {
    return !!this.pattern && minimatch(path.resolve(fileName), this.pattern);
  }
}

import type { JSONSchema7 } from 'json-schema';
import { tokens } from 'typed-inject';
import { StrykerOptions } from '@stryker-mutator/api/core';
import { commonTokens } from '@stryker-mutator/api/plugin';
import { Logger } from '@stryker-mutator/api/logging';
import { PropertyPathBuilder, findUnserializables } from '@stryker-mutator/util';

import { coreTokens } from '../di';
import { isWarningEnabled } from '../utils/object-utils';

markOptions.inject = tokens(commonTokens.options, coreTokens.validationSchema, commonTokens.logger);

/**
 * Performs additional validation on the Stryker options to mark unusual behavior with a warning.
 * Namely when a value isn't serializable or when unknown options are passed in.
 */
export function markOptions(options: StrykerOptions, schema: JSONSchema7, log: Logger): StrykerOptions {
  markUnknownOptions(options, schema, log);
  markUnserializableOptions(options, log);
  return options;
}

function markUnknownOptions(options: StrykerOptions, schema: JSONSchema7, log: Logger) {
  const OPTIONS_ADDED_BY_STRYKER = ['set', 'configFile', '$schema'];

  if (isWarningEnabled('unknownOptions', options.warnings)) {
    const schemaKeys = Object.keys(schema.properties!);
    const unknownPropertyNames = Object.keys(options)
      .filter((key) => !key.endsWith('_comment'))
      .filter((key) => !OPTIONS_ADDED_BY_STRYKER.includes(key))
      .filter((key) => !schemaKeys.includes(key));

    if (unknownPropertyNames.length) {
      unknownPropertyNames.forEach((unknownPropertyName) => {
        log.warn(`Unknown stryker config option "${unknownPropertyName}".`);
      });

      const p = PropertyPathBuilder.create<StrykerOptions>().prop('warnings').prop('unknownOptions').build();

      log.warn(`Possible causes:
   * Is it a typo on your end?
   * Did you only write this property as a comment? If so, please postfix it with "_comment".
   * You might be missing a plugin that is supposed to use it. Stryker loaded plugins from: ${JSON.stringify(options.plugins)}
   * The plugin that is using it did not contribute explicit validation. 
   (disable "${p}" to ignore this warning)`);
    }
  }
}

function markUnserializableOptions(options: StrykerOptions, log: Logger) {
  if (isWarningEnabled('unserializableOptions', options.warnings)) {
    const unserializables = findUnserializables(options);
    if (unserializables) {
      unserializables.forEach(({ reason, path }) =>
        log.warn(
          `Config option "${path.join(
            '.'
          )}" is not (fully) serializable. ${reason}. Any test runner or checker worker processes might not receive this value as intended.`
        )
      );
      const p = PropertyPathBuilder.create<StrykerOptions>().prop('warnings').prop('unserializableOptions').build();
      log.warn(`(disable ${p} to ignore this warning)`);
    }
  }
}

import os from 'os';

import { hasMagic } from 'glob';
import Ajv, { ValidateFunction } from 'ajv';
import { StrykerOptions, strykerCoreSchema } from '@stryker-mutator/api/core';
import { tokens, commonTokens } from '@stryker-mutator/api/plugin';
import { noopLogger, propertyPath, deepFreeze } from '@stryker-mutator/util';
import { Logger } from '@stryker-mutator/api/logging';
import type { JSONSchema7 } from 'json-schema';

import { coreTokens } from '../di';
import { ConfigError } from '../errors';
import { CommandTestRunner } from '../test-runner/command-test-runner';
import { IGNORE_PATTERN_CHARACTER, MUTATION_RANGE_REGEX } from '../input';

import { describeErrors } from './validation-errors';

const ajv = new Ajv({ useDefaults: true, allErrors: true, jsPropertySyntax: true, verbose: true, logger: false, strict: false });

export class OptionsValidator {
  private readonly validateFn: ValidateFunction;

  public static readonly inject = tokens(coreTokens.validationSchema, commonTokens.logger);

  constructor(schema: JSONSchema7, private readonly log: Logger) {
    this.validateFn = ajv.compile(schema);
  }

  public validate(options: Record<string, unknown>): asserts options is StrykerOptions {
    this.removeDeprecatedOptions(options);
    this.schemaValidate(options);
    this.additionalValidation(options);
  }

  private removeDeprecatedOptions(rawOptions: Record<string, unknown>) {
    if (typeof rawOptions.mutator === 'string') {
      this.log.warn(
        'DEPRECATED. Use of "mutator" as string is no longer needed. You can remove it from your configuration. Stryker now supports mutating of JavaScript and friend files out of the box.'
      );
      delete rawOptions.mutator;
    }
    // @ts-expect-error mutator.name
    if (typeof rawOptions.mutator === 'object' && rawOptions.mutator.name) {
      this.log.warn(
        'DEPRECATED. Use of "mutator.name" is no longer needed. You can remove "mutator.name" from your configuration. Stryker now supports mutating of JavaScript and friend files out of the box.'
      );
      // @ts-expect-error mutator.name
      delete rawOptions.mutator.name;
    }
    if (Object.keys(rawOptions).includes('testFramework')) {
      this.log.warn(
        'DEPRECATED. Use of "testFramework" is no longer needed. You can remove it from your configuration. Your test runner plugin now handles its own test framework integration.'
      );
      delete rawOptions.testFramework;
    }
    if (Array.isArray(rawOptions.transpilers)) {
      const example = rawOptions.transpilers.includes('babel')
        ? 'babel src --out-dir lib'
        : rawOptions.transpilers.includes('typescript')
        ? 'tsc -b'
        : rawOptions.transpilers.includes('webpack')
        ? 'webpack --config webpack.config.js'
        : 'npm run build';
      this.log.warn(
        `DEPRECATED. Support for "transpilers" is removed. You can now configure your own "${propertyPath<StrykerOptions>(
          'buildCommand'
        )}". For example, ${example}.`
      );
      delete rawOptions.transpilers;
    }
    if (Array.isArray(rawOptions.files)) {
      const ignorePatternsName = propertyPath<StrykerOptions>('ignorePatterns');
      const isString = (uncertain: unknown): uncertain is string => typeof uncertain === 'string';
      const files = rawOptions.files.filter(isString);
      const newIgnorePatterns: string[] = [
        '**',
        ...files.map((filePattern) =>
          filePattern.startsWith(IGNORE_PATTERN_CHARACTER) ? filePattern.substr(1) : `${IGNORE_PATTERN_CHARACTER}${filePattern}`
        ),
      ];
      delete rawOptions.files;
      this.log.warn(
        `DEPRECATED. Use of "files" is deprecated, please use "${ignorePatternsName}" instead (or remove "files" altogether will probably work as well). For now, rewriting them as ${JSON.stringify(
          newIgnorePatterns
        )}. See https://stryker-mutator.io/docs/stryker-js/configuration/#ignorepatterns-string`
      );
      const existingIgnorePatterns = Array.isArray(rawOptions[ignorePatternsName]) ? (rawOptions[ignorePatternsName] as unknown[]) : [];
      rawOptions[ignorePatternsName] = [...newIgnorePatterns, ...existingIgnorePatterns];
    }
    // @ts-expect-error jest.enableBail
    if (rawOptions.jest?.enableBail !== undefined) {
      this.log.warn(
        'DEPRECATED. Use of "jest.enableBail" inside deprecated, please use "disableBail" instead. See https://stryker-mutator.io/docs/stryker-js/configuration#disablebail-boolean'
      );
      // @ts-expect-error jest.enableBail
      rawOptions.disableBail = !rawOptions.jest?.enableBail;
      // @ts-expect-error jest.enableBail
      delete rawOptions.jest.enableBail;
    }
  }

  private additionalValidation(options: StrykerOptions) {
    const additionalErrors: string[] = [];
    if (options.thresholds.high < options.thresholds.low) {
      additionalErrors.push('Config option "thresholds.high" should be higher than "thresholds.low".');
    }
    if (options.maxConcurrentTestRunners !== Number.MAX_SAFE_INTEGER) {
      this.log.warn('DEPRECATED. Use of "maxConcurrentTestRunners" is deprecated. Please use "concurrency" instead.');
      if (!options.concurrency && options.maxConcurrentTestRunners < os.cpus().length - 1) {
        options.concurrency = options.maxConcurrentTestRunners;
      }
    }
    if (CommandTestRunner.is(options.testRunner)) {
      if (options.testRunnerNodeArgs.length) {
        this.log.warn(
          'Using "testRunnerNodeArgs" together with the "command" test runner is not supported, these arguments will be ignored. You can add your custom arguments by setting the "commandRunner.command" option.'
        );
      }
    }
    options.mutate.forEach((mutateString, index) => {
      const match = MUTATION_RANGE_REGEX.exec(mutateString);
      if (match) {
        if (hasMagic(mutateString)) {
          additionalErrors.push(
            `Config option "mutate[${index}]" is invalid. Cannot combine a glob expression with a mutation range in "${mutateString}".`
          );
        } else {
          const [_, _fileName, mutationRange, startLine, _startColumn, endLine, _endColumn] = match;
          const start = parseInt(startLine, 10);
          const end = parseInt(endLine, 10);
          if (start < 1) {
            additionalErrors.push(
              `Config option "mutate[${index}]" is invalid. Mutation range "${mutationRange}" is invalid, line ${start} does not exist (lines start at 1).`
            );
          }
          if (start > end) {
            additionalErrors.push(
              `Config option "mutate[${index}]" is invalid. Mutation range "${mutationRange}" is invalid. The "from" line number (${start}) should be less then the "to" line number (${end}).`
            );
          }
        }
      }
    });

    additionalErrors.forEach((error) => this.log.error(error));
    this.throwErrorIfNeeded(additionalErrors);
  }

  private schemaValidate(options: unknown): asserts options is StrykerOptions {
    if (!this.validateFn(options)) {
      const describedErrors = describeErrors(this.validateFn.errors!);
      describedErrors.forEach((error) => this.log.error(error));
      this.throwErrorIfNeeded(describedErrors);
    }
  }

  private throwErrorIfNeeded(errors: string[]) {
    if (errors.length > 0) {
      throw new ConfigError(
        errors.length === 1 ? 'Please correct this configuration error and try again.' : 'Please correct these configuration errors and try again.'
      );
    }
  }
}

export function defaultOptions(): StrykerOptions {
  const options: Record<string, unknown> = {};
  const validator: OptionsValidator = new OptionsValidator(strykerCoreSchema, noopLogger);
  validator.validate(options);
  return options;
}

validateOptions.inject = tokens(commonTokens.options, coreTokens.optionsValidator);
export function validateOptions(options: Record<string, unknown>, optionsValidator: OptionsValidator): StrykerOptions {
  optionsValidator.validate(options);
  return deepFreeze(options) as StrykerOptions;
}

import { ErrorObject } from 'ajv';

import groupby from 'lodash.groupby';

/**
 * Convert AJV errors to human readable messages
 * @param allErrors The AJV errors to describe
 */
export function describeErrors(allErrors: ErrorObject[]): string[] {
  const processedErrors = filterRelevantErrors(allErrors);
  return processedErrors.map(describeError);
}

/**
 * Filters the relevant AJV errors for error reporting.
 * Removes meta schema errors, merges type errors for the same `dataPath` and removes type errors for which another error also exist.
 * @param allErrors The raw source AJV errors
 * @example
 * This:
 *  ```
 *  [
 *   {
 *     keyword: 'type',
 *     dataPath: '.mutator',
 *     params: { type: 'string' },
 *     [...]
 *   },
 *   {
 *     keyword: 'required',
 *     dataPath: '.mutator',
 *     params: { missingProperty: 'name' },
 *     [...]
 *   },
 *   {
 *     keyword: 'oneOf',
 *     dataPath: '.mutator',
 *     params: { passingSchemas: null },
 *     [...]
 *   }
 *  ]
 *  ```
 *
 * Becomes:
 *  ```
 *  [
 *   {
 *    keyword: 'required',
 *    dataPath: '.mutator',
 *    params: { missingProperty: 'name' },
 *    [...]
 *   }
 *  ]
 *  ```
 */
function filterRelevantErrors(allErrors: ErrorObject[]): ErrorObject[] {
  // These are the "meta schema" keywords. A Meta schema is a schema consisting of other schemas. See https://json-schema.org/understanding-json-schema/structuring.html
  const META_SCHEMA_KEYWORDS = Object.freeze(['anyOf', 'allOf', 'oneOf']);

  // Split the meta errors from what I call "single errors" (the real errors)
  const [metaErrors, singleErrors] = split(allErrors, (error) => META_SCHEMA_KEYWORDS.includes(error.keyword));

  // Filter out the single errors we want to show
  const nonShadowedSingleErrors = removeShadowingErrors(singleErrors, metaErrors);

  // We're handling type errors differently, split them out
  const [typeErrors, nonTypeErrors] = split(nonShadowedSingleErrors, (error) => error.keyword === 'type');

  // Filter out the type errors that already have other errors as well.
  // For example when setting `logLevel: 4`, we don't want to see the error specifying that logLevel should be a string,
  // if the other error already specified that it should be one of the enum values.
  const nonShadowingTypeErrors = typeErrors.filter(
    (typeError) => !nonTypeErrors.some((nonTypeError) => nonTypeError.instancePath === typeError.instancePath)
  );
  const typeErrorsMerged = mergeTypeErrorsByPath(nonShadowingTypeErrors);
  return [...nonTypeErrors, ...typeErrorsMerged];
}

/**
 * Remove the single errors that are pointing to the same data path.
 * This can happen when using meta schemas.
 * For example, the "mutator" Stryker option can be either a `string` or a `MutatorDescriptor`.
 * A data object of `{ "foo": "bar" }` would result in 2 errors. One of a missing property "name" missing, and one that mutator itself should be a string.
 * @param singleErrors The 'real' errors
 * @param metaErrors The grouping errors
 */
function removeShadowingErrors(singleErrors: ErrorObject[], metaErrors: ErrorObject[]): ErrorObject[] {
  return singleErrors.filter((error) => {
    if (metaErrors.some((metaError) => error.instancePath.startsWith(metaError.instancePath))) {
      return !singleErrors.some(
        (otherError) => otherError.instancePath.startsWith(error.instancePath) && otherError.instancePath.length > error.instancePath.length
      );
    } else {
      return true;
    }
  });
}

function split<T>(items: T[], splitFn: (item: T) => boolean): [T[], T[]] {
  return [items.filter(splitFn), items.filter((error) => !splitFn(error))];
}

/**
 * Merge type errors that have the same path into 1.
 * @example
 *  The 'plugins' Stryker option can have 2 types, null or an array of strings.
 *  When setting  `plugins: 'my-plugin'` we get 2 type errors, because it isn't an array AND it isn't `null`.
 * @param typeErrors The type errors to merge by path
 */
function mergeTypeErrorsByPath(typeErrors: ErrorObject[]): ErrorObject[] {
  const typeErrorsByPath = groupby(typeErrors, (error) => error.instancePath);
  return Object.values(typeErrorsByPath).map(mergeTypeErrors);

  function mergeTypeErrors(errors: ErrorObject[]): ErrorObject {
    const params = {
      type: errors.map((error) => error.params.type).join(','),
    };
    return {
      ...errors[0],
      params,
    };
  }
}

/**
 * Converts the AJV error object to a human readable error.
 * @param error The error to describe
 */
function describeError(error: ErrorObject): string {
  const errorPrefix = `Config option "${error.instancePath.substr(1)}"`;

  switch (error.keyword) {
    case 'type':
      const expectedTypeDescription = error.params.type.split(',').join(' or ');
      return `${errorPrefix} has the wrong type. It should be a ${expectedTypeDescription}, but was a ${jsonSchemaType(error.data)}.`;
    case 'enum':
      return `${errorPrefix} should be one of the allowed values (${error.params.allowedValues.map(stringify).join(', ')}), but was ${stringify(
        error.data
      )}.`;
    case 'minimum':
    case 'maximum':
      return `${errorPrefix} ${error.message}, was ${error.data}.`;
    default:
      return `${errorPrefix} ${error.message!.replace(/'/g, '"')}`;
  }
}

/**
 * Returns the JSON schema name of the type. JSON schema types are slightly different from actual JS types.
 * @see https://json-schema.org/understanding-json-schema/reference/type.html
 * @param value The value of which it's type should be known
 */
function jsonSchemaType(value: unknown): string {
  if (value === null) {
    return 'null';
  }
  if (value === undefined) {
    return 'undefined';
  }
  if (Array.isArray(value)) {
    return 'array';
  }
  return typeof value;
}

function stringify(value: unknown): string {
  if (typeof value === 'number' && isNaN(value)) {
    return 'NaN';
  } else {
    return JSON.stringify(value);
  }
}

