import inquirer from 'inquirer';

import { CommandTestRunner } from '../test-runner/command-test-runner';

import { ChoiceType } from './choice-type';
import { Preset } from './presets/preset';
import { PromptOption } from './prompt-option';

export interface PromptResult {
  additionalNpmDependencies: string[];
  additionalConfig: Record<string, unknown>;
}

export class StrykerInquirer {
  public async promptPresets(options: Preset[]): Promise<Preset | undefined> {
    const choices: ChoiceType[] = options.map((_) => _.name);
    choices.push(new inquirer.Separator());
    choices.push('None/other');
    const answers = await inquirer.prompt<{ preset: string }>({
      choices,
      message: 'Are you using one of these frameworks? Then select a preset configuration.',
      name: 'preset',
      type: 'list',
    });
    return options.find((_) => _.name === answers.preset);
  }

  public async promptTestRunners(options: PromptOption[]): Promise<PromptOption> {
    if (options.length) {
      const choices: ChoiceType[] = options.map((_) => _.name);
      choices.push(new inquirer.Separator());
      choices.push(CommandTestRunner.runnerName);
      const answers = await inquirer.prompt<{ testRunner: string }>({
        choices,
        message:
          'Which test runner do you want to use? If your test runner isn\'t listed here, you can choose "command" (it uses your `npm test` command, but will come with a big performance penalty)',
        name: 'testRunner',
        type: 'list',
      });
      return options.filter((_) => _.name === answers.testRunner)[0] ?? { name: CommandTestRunner.runnerName, pkg: null };
    } else {
      return { name: CommandTestRunner.runnerName, pkg: null };
    }
  }

  public async promptReporters(options: PromptOption[]): Promise<PromptOption[]> {
    const answers = await inquirer.prompt<{ reporters: string[] }>({
      choices: options.map((_) => _.name),
      default: ['html', 'clear-text', 'progress'],
      message: 'Which reporter(s) do you want to use?',
      name: 'reporters',
      type: 'checkbox',
    });
    return options.filter((option) => answers.reporters.some((reporterName) => option.name === reporterName));
  }

  public async promptPackageManager(options: PromptOption[]): Promise<PromptOption> {
    const answers = await inquirer.prompt<{ packageManager: string }>({
      choices: options.map((_) => _.name),
      default: ['npm'],
      message: 'Which package manager do you want to use?',
      name: 'packageManager',
      type: 'list',
    });
    return options.filter((_) => _.name === answers.packageManager)[0];
  }

  public async promptJsonConfigType(): Promise<boolean> {
    const json = 'JSON';

    const answers = await inquirer.prompt<{ configType: string }>({
      choices: [json, 'JavaScript'],
      default: json,
      message: 'What file type do you want for your config file?',
      name: 'configType',
      type: 'list',
    });
    return answers.configType === json;
  }
}

import { File, MutationRange } from '@stryker-mutator/api/core';
import { Logger } from '@stryker-mutator/api/logging';
import { normalizeWhitespaces } from '@stryker-mutator/util';

export class InputFileCollection {
  public readonly files: readonly File[];
  public readonly filesToMutate: readonly File[];
  public readonly mutationRanges: readonly MutationRange[];

  constructor(files: readonly File[], mutateGlobResult: readonly string[], mutationRangeToInstrument: readonly MutationRange[]) {
    this.files = files;
    this.filesToMutate = files.filter((file) => mutateGlobResult.some((name) => name === file.name));
    this.mutationRanges = mutationRangeToInstrument;
  }

  public logFiles(log: Logger, ignoreRules: readonly string[]): void {
    if (!this.files.length) {
      log.warn(
        normalizeWhitespaces(`No files found in directory ${process.cwd()} using ignore rules: ${JSON.stringify(ignoreRules)}. 
      Make sure you run Stryker from the root directory of your project with the correct "ignorePatterns".`)
      );
    } else {
      if (this.filesToMutate.length) {
        log.info(`Found ${this.filesToMutate.length} of ${this.files.length} file(s) to be mutated.`);
      } else {
        log.warn(
          normalizeWhitespaces(`No files marked to be mutated, Stryker will perform a dry-run without actually mutating anything.
        You can configure the \`mutate\` property in your config file (or use \`--mutate\` via command line).`)
        );
      }
      if (log.isDebugEnabled()) {
        log.debug(
          `All input files: ${JSON.stringify(
            this.files.map((file) => file.name),
            null,
            2
          )}`
        );
        log.debug(
          `Files to mutate: ${JSON.stringify(
            this.filesToMutate.map((file) => file.name),
            null,
            2
          )}`
        );
      }
    }
  }
}

