import { plural } from '../utils/string-utils';

import { ClearTextScoreTable } from './clear-text-score-table';

const { MutantStatus } = schema;

export class ClearTextReporter implements Reporter {
  public static inject = tokens(commonTokens.logger, commonTokens.options);
  constructor(private readonly log: Logger, private readonly options: StrykerOptions) {
    this.configConsoleColor();
  }

  private readonly out: NodeJS.WritableStream = process.stdout;

  private readonly writeLine = (output?: string) => {
    this.out.write(`${output ?? ''}${os.EOL}`);
  };

  private readonly writeDebugLine = (input: string) => {
    this.log.debug(input);
  };

  private configConsoleColor() {
    if (!this.options.allowConsoleColors) {
      chalk.level = 0; // All colors disabled
    }
  }

  public onMutationTestReportReady(_report: schema.MutationTestResult, metrics: MutationTestMetricsResult): void {
    this.writeLine();
    this.reportAllTests(metrics);
    this.reportAllMutants(metrics);
    this.writeLine(new ClearTextScoreTable(metrics.systemUnderTestMetrics, this.options.thresholds).draw());
  }

  private reportAllTests(metrics: MutationTestMetricsResult) {
    function indent(depth: number) {
      return new Array(depth).fill('  ').join('');
    }
    const formatTestLine = (test: TestModel, state: string): string => {
      return `${this.color('grey', `${test.name}${test.location ? ` [line ${test.location.start.line}]` : ''}`)} (${state})`;
    };

    if (metrics.testMetrics) {
      const reportTests = (currentResult: MetricsResult<TestFileModel, TestMetrics>, depth = 0) => {
        const nameParts: string[] = [currentResult.name];
        while (!currentResult.file && currentResult.childResults.length === 1) {
          currentResult = currentResult.childResults[0];
          nameParts.push(currentResult.name);
        }
        this.writeLine(`${indent(depth)}${nameParts.join('/')}`);
        currentResult.file?.tests.forEach((test) => {
          switch (test.status) {
            case TestStatus.Killing:
              this.writeLine(`${indent(depth + 1)}${this.color('greenBright', '')} ${formatTestLine(test, `killed ${test.killedMutants?.length}`)}`);
              break;
            case TestStatus.Covering:
              this.writeLine(
                `${indent(depth + 1)}${this.color('blueBright', '~')} ${formatTestLine(test, `covered ${test.coveredMutants?.length}`)}`
              );
              break;
            case TestStatus.NotCovering:
              this.writeLine(`${indent(depth + 1)}${this.color('redBright', '')} ${formatTestLine(test, 'covered 0')}`);
              break;
          }
        });
        currentResult.childResults.forEach((childResult) => reportTests(childResult, depth + 1));
      };
      reportTests(metrics.testMetrics);
    }
  }

  private reportAllMutants({ systemUnderTestMetrics }: MutationTestMetricsResult): void {
    this.writeLine();
    let totalTests = 0;

    const reportMutants = (metrics: MetricsResult[]) => {
      metrics.forEach((child) => {
        child.file?.mutants.forEach((result) => {
          totalTests += result.testsCompleted ?? 0;
          switch (result.status) {
            case MutantStatus.Killed:
            case MutantStatus.Timeout:
            case MutantStatus.RuntimeError:
            case MutantStatus.CompileError:
              this.reportMutantResult(result, this.writeDebugLine);
              break;
            case MutantStatus.Survived:
            case MutantStatus.NoCoverage:
              this.reportMutantResult(result, this.writeLine);
              break;
            default:
          }
        });
        reportMutants(child.childResults);
      });
    };
    reportMutants(systemUnderTestMetrics.childResults);
    this.writeLine(`Ran ${(totalTests / systemUnderTestMetrics.metrics.totalMutants).toFixed(2)} tests per mutant on average.`);
  }

  private reportMutantResult(result: MutantModel, logImplementation: (input: string) => void): void {
    logImplementation(`#${result.id}. [${MutantStatus[result.status]}] ${result.mutatorName}`);
    logImplementation(this.colorSourceFileAndLocation(result.fileName, result.location.start));

    result
      .getOriginalLines()
      .split('\n')
      .filter(Boolean)
      .forEach((line) => {
        logImplementation(chalk.red('-   ' + line));
      });
    result
      .getMutatedLines()
      .split('\n')
      .filter(Boolean)
      .forEach((line) => {
        logImplementation(chalk.green('+   ' + line));
      });
    if (result.status === MutantStatus.Survived) {
      if (result.static) {
        logImplementation('Ran all tests for this mutant.');
      } else if (result.coveredByTests) {
        this.logExecutedTests(result.coveredByTests, logImplementation);
      }
    } else if (result.status === MutantStatus.Killed && result.killedByTests && result.killedByTests.length) {
      logImplementation(`Killed by: ${result.killedByTests[0].name}`);
    } else if (result.status === MutantStatus.RuntimeError || result.status === MutantStatus.CompileError) {
      logImplementation(`Error message: ${result.statusReason}`);
    }
    logImplementation('');
  }

  private colorSourceFileAndLocation(fileName: string, position: Position): string {
    return [this.color('cyan', fileName), this.color('yellow', position.line), this.color('yellow', position.column)].join(':');
  }

  private color(color: typeof Color, ...text: unknown[]) {
    if (this.options.clearTextReporter.allowColor) {
      return chalk[color](...text);
    }
    return text.join('');
  }

  private logExecutedTests(tests: TestModel[], logImplementation: (input: string) => void) {
    if (!this.options.clearTextReporter.logTests) {
      return;
    }

    const testCount = Math.min(this.options.clearTextReporter.maxTestsToLog, tests.length);

    if (testCount > 0) {
      logImplementation('Tests ran:');
      tests.slice(0, testCount).forEach((test) => {
        logImplementation(`    ${test.name}`);
      });
      const diff = tests.length - this.options.clearTextReporter.maxTestsToLog;
      if (diff > 0) {
        logImplementation(`  and ${diff} more test${plural(diff)}!`);
      }
      logImplementation('');
    }
  }
}

import os from 'os';

import { MutationScoreThresholds } from '@stryker-mutator/api/core';
import { MetricsResult } from 'mutation-testing-metrics';

import chalk from 'chalk';
import flatMap from 'lodash.flatmap';

const FILES_ROOT_NAME = 'All files';

type TableCellValueFactory = (row: MetricsResult, ancestorCount: number) => string;

const repeat = (char: string, nTimes: number) => new Array(nTimes > -1 ? nTimes + 1 : 0).join(char);
const spaces = (n: number) => repeat(' ', n);
const dots = (n: number) => repeat('.', n);

/**
 * Represents a column in the clear text table
 */
class Column {
  protected width: number;

  constructor(public header: string, public valueFactory: TableCellValueFactory, public rows: MetricsResult) {
    const maxContentSize = this.determineValueSize();
    this.width = this.pad(dots(maxContentSize)).length;
  }

  protected determineValueSize(row: MetricsResult = this.rows, ancestorCount = 0): number {
    const valueWidths = row.childResults.map((child) => this.determineValueSize(child, ancestorCount + 1));
    valueWidths.push(this.header.length);
    valueWidths.push(this.valueFactory(row, ancestorCount).length);
    return Math.max(...valueWidths);
  }

  /**
   * Adds padding (spaces) to the front and end of a value
   * @param input The string input
   */
  protected pad(input: string): string {
    return `${spaces(this.width - input.length - 2)} ${input} `;
  }

  public drawLine(): string {
    return repeat('-', this.width);
  }

  public drawTableCell(score: MetricsResult, ancestorCount: number) {
    return this.color(score)(this.pad(this.valueFactory(score, ancestorCount)));
  }

  public drawHeader() {
    return this.pad(this.header);
  }

  protected color(_score: MetricsResult) {
    return (input: string) => input;
  }
}

class MutationScoreColumn extends Column {
  constructor(rows: MetricsResult, private readonly thresholds: MutationScoreThresholds) {
    super('% score', (row) => row.metrics.mutationScore.toFixed(2), rows);
  }
  protected color(metricsResult: MetricsResult) {
    if (metricsResult.metrics.mutationScore >= this.thresholds.high) {
      return chalk.green;
    } else if (metricsResult.metrics.mutationScore >= this.thresholds.low) {
      return chalk.yellow;
    } else {
      return chalk.red;
    }
  }
}

class FileColumn extends Column {
  constructor(rows: MetricsResult) {
    super('File', (row, ancestorCount) => spaces(ancestorCount) + (ancestorCount === 0 ? FILES_ROOT_NAME : row.name), rows);
  }
  protected pad(input: string): string {
    return `${input} ${spaces(this.width - input.length - 1)}`;
  }
}

/**
 * Represents a clear text table for mutation score
 */
export class ClearTextScoreTable {
  private readonly columns: Column[];

  constructor(private readonly metricsResult: MetricsResult, thresholds: MutationScoreThresholds) {
    this.columns = [
      new FileColumn(metricsResult),
      new MutationScoreColumn(metricsResult, thresholds),
      new Column('# killed', (row) => row.metrics.killed.toString(), metricsResult),
      new Column('# timeout', (row) => row.metrics.timeout.toString(), metricsResult),
      new Column('# survived', (row) => row.metrics.survived.toString(), metricsResult),
      new Column('# no cov', (row) => row.metrics.noCoverage.toString(), metricsResult),
      new Column('# error', (row) => (row.metrics.runtimeErrors + row.metrics.compileErrors).toString(), metricsResult),
    ];
  }

  private drawBorder() {
    return this.drawRow((column) => column.drawLine());
  }

  private drawHeader() {
    return this.drawRow((c) => c.drawHeader());
  }

  private drawRow(toDraw: (col: Column) => string) {
    return this.columns.map(toDraw).join('|') + '|';
  }

  private drawValues(current = this.metricsResult, ancestorCount = 0): string[] {
    return [this.drawRow((c) => c.drawTableCell(current, ancestorCount))].concat(
      flatMap(current.childResults, (child) => this.drawValues(child, ancestorCount + 1))
    );
  }

  /**
   * Returns a string with the score results drawn in a table.
   */
  public draw(): string {
    return [this.drawBorder(), this.drawHeader(), this.drawBorder(), this.drawValues().join(os.EOL), this.drawBorder()].join(os.EOL);
  }
}

