export const deleteDir = promisify(rimraf);

export async function cleanFolder(folderName: string): Promise<string | undefined> {
  try {
    await fs.promises.lstat(folderName);
    await deleteDir(folderName);
    return mkdirp(folderName);
  } catch (e) {
    return mkdirp(folderName);
  }
}

/**
 * Wrapper around the 'require' function (for testability)
 */
export function importModule(moduleName: string): unknown {
  // eslint-disable-next-line @typescript-eslint/no-require-imports
  return require(moduleName);
}

/**
 * Recursively walks the from directory and copy the content to the target directory synchronously
 * @param from The source directory to move from
 * @param to The target directory to move to
 */
export function moveDirectoryRecursiveSync(from: string, to: string): void {
  if (!fs.existsSync(from)) {
    return;
  }
  if (!fs.existsSync(to)) {
    fs.mkdirSync(to);
  }
  const files = fs.readdirSync(from);
  for (const file of files) {
    const fromFileName = path.join(from, file);
    const toFileName = path.join(to, file);
    const stats = fs.lstatSync(fromFileName);
    if (stats.isFile()) {
      fs.renameSync(fromFileName, toFileName);
    } else {
      moveDirectoryRecursiveSync(fromFileName, toFileName);
    }
  }
  fs.rmdirSync(from);
}

/**
 * Creates a symlink at `from` that points to `to`
 * @param to The thing you want to point to
 * @param from The thing you want to point from
 */
export async function symlinkJunction(to: string, from: string): Promise<void> {
  await fs.promises.mkdir(path.dirname(from), { recursive: true });
  return fs.promises.symlink(to, from, 'junction');
}

/**
 * Looks for the node_modules folder from basePath up to root.
 * returns the first occurrence of the node_modules, or null of none could be found.
 * @param basePath starting point
 */
export async function findNodeModulesList(basePath: string, tempDirName?: string): Promise<string[]> {
  const nodeModulesList: string[] = [];
  const dirBfsQueue: string[] = ['.'] ?? [];

  let dir: string | undefined;
  while ((dir = dirBfsQueue.pop())) {
    if (path.basename(dir) === tempDirName) {
      continue;
    }

    if (path.basename(dir) === 'node_modules') {
      nodeModulesList.push(dir);
      continue;
    }

    const parentDir = dir;
    const filesWithType = await fs.promises.readdir(path.join(basePath, dir), { withFileTypes: true });
    const dirs = filesWithType.filter((file) => file.isDirectory()).map((childDir) => path.join(parentDir, childDir.name));
    dirBfsQueue.push(...dirs);
  }

  return nodeModulesList;
}

import getPort from 'get-port';

/**
 * A wrapper around `getPort` for testing purposes
 */
export const getFreePort = getPort;

export function isOK(statusCode: number): boolean {
  return statusCode >= 200 && statusCode < 300;
}

import treeKill from 'tree-kill';
import { StrykerError, KnownKeys } from '@stryker-mutator/util';
import { WarningOptions } from '@stryker-mutator/api/core';

/**
 * A wrapper around `process.env` (for testability)
 */
export function getEnvironmentVariable(nameEnvironmentVariable: string): string | undefined {
  return process.env[nameEnvironmentVariable];
}

export function undefinedEmptyString(str: string | undefined): string | undefined {
  if (str) {
    return str;
  }
  return undefined;
}

export function getEnvironmentVariableOrThrow(name: string): string {
  const value = getEnvironmentVariable(name);
  if (value === undefined) {
    throw new StrykerError(`Missing environment variable "${name}"`);
  } else {
    return value;
  }
}

export function isWarningEnabled(warningType: KnownKeys<WarningOptions>, warningOptions: WarningOptions | boolean): boolean {
  if (typeof warningOptions === 'boolean') {
    return warningOptions;
  } else {
    return !!warningOptions[warningType];
  }
}

/**
 * A wrapper around `process.exitCode = n` (for testability)
 */
export function setExitCode(n: number): void {
  process.exitCode = n;
}

export function kill(pid: number | undefined): Promise<void> {
  return new Promise((res, rej) => {
    treeKill(pid!, 'SIGKILL', (err?: Error & { code?: number }) => {
      if (err && !canIgnore(err.code)) {
        rej(err);
      } else {
        res();
      }
    });

    function canIgnore(code: number | undefined) {
      // https://docs.microsoft.com/en-us/windows/desktop/Debug/system-error-codes--0-499-
      // these error codes mean the program is _already_ closed.
      return code === 255 || code === 128;
    }
  });
}

/**
 * Creates a random integer number.
 * @returns A random integer.
 */
export function random(): number {
  return Math.ceil(Math.random() * 10000000);
}

import { EOL } from 'os';

const DEFAULT_MAX_SIZE = 2048;

export class StringBuilder {
  private currentLength = 0;
  private readonly strings: string[] = [];
  private readonly maxSize = DEFAULT_MAX_SIZE;

  public append(str: string): void {
    this.strings.push(str);
    this.currentLength += str.length;
    while (this.currentLength > this.maxSize && this.strings.length > 1) {
      const shifted = this.strings.shift()!;
      this.currentLength -= shifted.length;
    }
  }

  public toString(): string {
    return this.strings.join('');
  }

  public static concat(...builders: StringBuilder[]): string {
    return builders
      .map((b) => b.toString())
      .filter(Boolean)
      .join(EOL);
  }
}

export function wrapInClosure(codeFragment: string): string {
  return `
    (function (window) {
      ${codeFragment}
    })((Function('return this'))());`;
}

export function padLeft(input: string): string {
  return input
    .split('\n')
    .map((str) => '\t' + str)
    .join('\n');
}

export function plural(items: number): string {
  if (items > 1) {
    return 's';
  } else {
    return '';
  }
}

export function serialize(thing: unknown): string {
  return JSON.stringify(thing);
}

export function deserialize<T>(stringified: string): T {
  return JSON.parse(stringified);
}

import path from 'path';
import { createReadStream, createWriteStream } from 'fs';

import { StrykerOptions } from '@stryker-mutator/api/core';
import { Logger } from '@stryker-mutator/api/logging';
import { commonTokens, tokens } from '@stryker-mutator/api/plugin';
import mkdirp from 'mkdirp';
import { Disposable } from 'typed-inject';

import { deleteDir } from './file-utils';
import { random } from './object-utils';

export class TemporaryDirectory implements Disposable {
  private readonly temporaryDirectory: string;
  private isInitialized = false;
  public removeDuringDisposal: boolean;

  public static readonly inject = tokens(commonTokens.logger, commonTokens.options);
  constructor(private readonly log: Logger, options: StrykerOptions) {
    this.temporaryDirectory = path.resolve(options.tempDirName);
    this.removeDuringDisposal = options.cleanTempDir;
  }

  public initialize(): void {
    this.isInitialized = true;
    this.log.debug('Using temp directory "%s"', this.temporaryDirectory);
    mkdirp.sync(this.temporaryDirectory);
  }

  /**
   * Creates a new random directory with the specified prefix.
   * @param prefix The prefix.
   * @returns The path to the directory.
   */
  public createRandomDirectory(prefix: string): string {
    if (!this.isInitialized) {
      throw new Error('initialize() was not called!');
    }
    const dir = path.resolve(this.temporaryDirectory, `${prefix}${random()}`);
    mkdirp.sync(dir);
    return dir;
  }

  /**
   * Copies a file.
   * @param fromFilename The path to the existing file.
   * @param toFilename The path to copy the file to.
   * @param instrumenter An optional additional instrumenter to stream the file through
   * @returns A promise to eventually copy the file.
   */
  public copyFile(fromFilename: string, toFilename: string, instrumenter: NodeJS.ReadWriteStream | null): Promise<void> {
    return new Promise<void>((resolve, reject) => {
      let readStream: NodeJS.ReadableStream = createReadStream(fromFilename, { encoding: 'utf8' });
      const writeStream = createWriteStream(toFilename);
      readStream.on('error', reject);
      writeStream.on('error', reject);
      if (instrumenter) {
        readStream = readStream.pipe(instrumenter);
      }
      readStream.pipe(writeStream);
      readStream.on('end', () => resolve());
    });
  }

  /**
   * Deletes the Stryker-temp directory
   */
  public async dispose(): Promise<void> {
    if (!this.isInitialized) {
      throw new Error('initialize() was not called!');
    }
    if (this.removeDuringDisposal) {
      this.log.debug('Deleting stryker temp directory %s', this.temporaryDirectory);
      try {
        await deleteDir(this.temporaryDirectory);
      } catch (e) {
        this.log.info(`Failed to delete stryker temp directory ${this.temporaryDirectory}`);
      }
    }
  }
}

export class Timer {
  private readonly start: Date;
  private readonly markers: Record<string, Date | undefined> = Object.create(null);

  constructor(private readonly now = () => new Date()) {
    this.start = this.now();
  }
  public humanReadableElapsed(sinceMarker?: string): string {
    const elapsedSeconds = this.elapsedSeconds(sinceMarker);
    return Timer.humanReadableElapsedMinutes(elapsedSeconds) + Timer.humanReadableElapsedSeconds(elapsedSeconds);
  }

  public elapsedSeconds(sinceMarker?: string): number {
    const elapsedMs = this.elapsedMs(sinceMarker);
    return Math.floor(elapsedMs / 1000);
  }

  public elapsedMs(sinceMarker?: string): number {
    const marker = sinceMarker && this.markers[sinceMarker];
    if (marker) {
      return this.now().getTime() - marker.getTime();
    } else {
      return this.now().getTime() - this.start.getTime();
    }
  }

  public mark(name: string): void {
    this.markers[name] = this.now();
  }

  private static humanReadableElapsedSeconds(elapsedSeconds: number) {
    const restSeconds = elapsedSeconds % 60;
    return this.formatTime('second', restSeconds);
  }

  private static humanReadableElapsedMinutes(elapsedSeconds: number) {
    const elapsedMinutes = Math.floor(elapsedSeconds / 60);
    if (elapsedMinutes === 0) {
      return '';
    } else {
      return this.formatTime('minute', elapsedMinutes);
    }
  }

  private static formatTime(word: 'minute' | 'second', elapsed: number) {
    const s = elapsed === 1 ? '' : 's';
    const blank = word === 'minute' ? ' ' : '';
    return `${elapsed} ${word}${s}${blank}`;
  }
}
